import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import PatientDashboard from './components/PatientDashboard';

function App() {
  const [user, setUser] = useState(null);

  const handleLogin = (userData) => {
    console.log('Logged in user:', userData);
    setUser(userData);
  };

  const handleLogout = () => {
    console.log('Logged out');
    setUser(null);
  };

  return (
    <Router>
      <div className="min-h-screen bg-gray-100">
        <header className="p-4 bg-blue-600 text-white">
          <h1 className="text-2xl">ToothSmilePlus Dental Clinic</h1>
          {user ? (
            <button onClick={handleLogout} className="ml-4 bg-red-500 p-2 rounded">Logout</button>
          ) : null}
        </header>
        <main className="p-4">
          <Routes>
            <Route path="/login" element={<Login onLogin={handleLogin} />} />
            <Route
              path="/patient-dashboard"
              element={user && user.role === 'patient' ? <PatientDashboard user={user} /> : <Login onLogin={handleLogin} />}
            />
            <Route path="/" element={<Login onLogin={handleLogin} />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
